	@Inject
	public KTraceGrammarAccess(GrammarProvider grammarProvider,
			KExtGrammarAccess gaKExt,
			KEffectsGrammarAccess gaKEffects,
			KExpressionsGrammarAccess gaKExpressions,
			AnnotationsGrammarAccess gaAnnotations,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaKExt = gaKExt;
		this.gaKEffects = gaKEffects;
		this.gaKExpressions = gaKExpressions;
		this.gaAnnotations = gaAnnotations;
		this.gaTerminals = gaTerminals;
		this.pTraceFile = new TraceFileElements();
		this.pEsoTraces = new EsoTracesElements();
		this.pEsoTrace = new EsoTraceElements();
		this.pEsoTick = new EsoTickElements();
		this.pKVPair = new KVPairElements();
		this.pKTraces = new KTracesElements();
		this.pKTrace = new KTraceElements();
		this.pKTick = new KTickElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("de.cau.cs.kieler.simulation.trace.KTrace".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
